INSERT INTO `recipe` (`recipeTitle`, `recipeImg`, `description`, `ingredients`, `instruction`, `serving`, `category`) VALUES
('Chicken Caldereta', , 'Chicken Caldereta is a Filipino stew characterized by its rich and flavorful tomato-based sauce. This dish is made with chicken, vegetables, liver spread, and a blend of savory and spicy seasonings.', '    1 kg chicken, cut into serving pieces\r\n    2 large potatoes, peeled and sliced\r\n    2 large carrots, peeled and sliced\r\n    1 red bell pepper, sliced\r\n    1 green bell pepper, sliced\r\n    1 cup green peas (fresh or frozen)\r\n    1 cup tomato sauce\r\n    1/2 cup liver spread\r\n    1 large onion, chopped\r\n    4 cloves garlic, minced\r\n    2 cups chicken broth\r\n    2 bay leaves\r\n    1 teaspoon paprika\r\n    1 teaspoon sugar\r\n    Salt and pepper to taste\r\n    Cooking oil', '    In a pot, heat oil and saut√© garlic and onions until aromatic.\r\n    Add chicken and cook until browned.\r\n    Stir in liver spread, tomato sauce, paprika, and sugar. Mix well.\r\n    Pour in chicken broth and add bay leaves. Bring to a boil.\r\n    Add potatoes, carrots, and bell peppers. Simmer until vegetables are tender.\r\n    Add green peas and season with salt and pepper to taste.\r\n    Continue simmering until the sauce thickens.\r\n    Serve hot over steamed rice.', 6, 'Dinner'),
('Halo-halo', , 'Halo-Halo is a popular Filipino dessert that translates to \"mix-mix.\" It\'s a delightful and colorful concoction of shaved ice, various sweet ingredients, and evaporated milk. This refreshing treat offers a mix of textures and flavors.', '    Shaved ice\r\n    Sweetened fruits and preserves (bananas, jackfruit, sweet beans, nata de coco, etc.)\r\n    Leche flan (caramel custard)\r\n    Ube halaya (purple yam jam)\r\n    Sweetened macapuno (coconut sport)\r\n    Sago (tapioca pearls)\r\n    Pinipig (toasted young rice)\r\n    Evaporated milk\r\n    Sugar to taste\r\n    Crushed ice', '    Fill a glass or bowl with shaved ice.\r\n    Arrange sweet ingredients over the ice.\r\n    Drizzle with evaporated milk and sugar to taste.\r\n    Top with leche flan, ube halaya, sweetened macapuno, sago, and pinipig.\r\n    Mix everything thoroughly before enjoying.', 1, 'Dessert');
INSERT INTO `recipe` (`recipeTitle`, `recipeImg`, `description`, `ingredients`, `instruction`, `serving`, `category`) VALUES
('Mini Caprese Skewers with Balsamic Glaze', , 'These Mini Caprese Skewers are bite-sized delights that capture the classic flavors of Caprese salad. Fresh mozzarella, cherry tomatoes, and basil leaves are threaded onto skewers and drizzled with a luscious balsamic glaze, creating an elegant and flavorful appetizer.', '    Fresh mozzarella balls\r\n    Cherry tomatoes\r\n    Fresh basil leaves\r\n    Balsamic glaze\r\n    Wooden skewers', '    Take a wooden skewer and thread a fresh mozzarella ball, a cherry tomato, and a fresh basil leaf.\r\n    Repeat the process until the skewer is filled with a balanced combination of mozzarella, tomato, and basil.\r\n    Arrange the mini Caprese skewers on a serving platter.\r\n    Drizzle balsamic glaze over the skewers just before serving, ensuring a delightful burst of flavor.\r\n    Serve immediately and enjoy the harmonious blend of textures and tastes in each bite.', 3, 'Appetizer'),
('Molten Chocolate Lava Cake', , 'Molten Chocolate Lava Cake is a decadent dessert with a gooey, molten center. It\'s a delightful combination of a rich chocolate exterior and a warm, liquid chocolate interior, creating a heavenly treat for chocolate lovers.', '    1/2 cup (1 stick) unsalted butter\r\n    1 cup semi-sweet or bittersweet chocolate chips\r\n    1 and 1/2 cups powdered sugar\r\n    3 large eggs\r\n    1 teaspoon vanilla extract\r\n    1/2 cup all-purpose flour\r\n    Pinch of salt\r\n    Optional: Vanilla ice cream and powdered sugar for serving', '    Preheat the oven to 425¬∞F (220¬∞C). Grease and flour individual ramekins.\r\n    In a microwave-safe bowl, melt the butter and chocolate chips together until smooth.\r\n    Stir in the powdered sugar until well combined.\r\n    Add the eggs one at a time, mixing well after each addition. Stir in the vanilla extract.\r\n    Fold in the flour and a pinch of salt until just combined.\r\n    Divide the batter among the prepared ramekins.\r\n    Bake for 12-14 minutes or until the edges are set but the center is still soft.\r\n    Let the cakes cool for a minute before inverting onto serving plates.\r\n    Dust with powdered sugar and serve with vanilla ice cream if desired.', 1, 'Dessert');
INSERT INTO `recipe` (`recipeTitle`, `recipeImg`, `description`, `ingredients`, `instruction`, `serving`, `category`) VALUES
('Pork Menudo', , 'Pork Menudo is a classic Filipino dish known for its savory and tomato-based sauce. It features pork, liver, potatoes, carrots, and peas, creating a flavorful and hearty stew.', '    500g pork belly, diced\r\n    200g pork liver, sliced into strips\r\n    1 large potato, diced\r\n    1 large carrot, diced\r\n    1 cup green peas (fresh or frozen)\r\n    1 red bell pepper, diced\r\n    1 green bell pepper, diced\r\n    1 large onion, chopped\r\n    4 cloves garlic, minced\r\n    2 cups tomato sauce\r\n    1 cup pork broth or water\r\n    2 bay leaves\r\n    2 tablespoons soy sauce\r\n    1 tablespoon fish sauce\r\n    Salt and pepper to taste\r\n    Cooking oil', '    In a pan, heat oil and saut√© garlic and onions until fragrant.\r\n    Add pork and cook until browned.\r\n    Stir in soy sauce, fish sauce, and tomato sauce. Mix well.\r\n    Pour in pork broth, add bay leaves, and simmer until pork is tender.\r\n    Add liver, potatoes, carrots, and bell peppers. Simmer until vegetables are cooked.\r\n    Add green peas and season with salt and pepper to taste.\r\n    Continue simmering until the sauce thickens.\r\n    Serve hot over steamed rice.', 6, 'Dinner'),
('sinigang', 0x73696e6967616e67206e61206261626f792e6a706567, 'testing', 'testing', 'testing', 6, 'Drinks'),
('Sinigang na Baboy', , 'Dive into a bowl of Filipino sunshine! Sinigang na Baboy\'s tangy tamarind broth bathes tender pork belly, crisp vegetables, and vibrant aromatics. Each spoonful is a heartwarming melody of sour, savory, and fresh, leaving you wanting more.', '    500g pork ribs or belly, cut into serving pieces\r\n    1 large onion, peeled and quartered\r\n    2 medium-sized tomatoes, quartered\r\n    1 radish (labanos), peeled and sliced\r\n    2 eggplants (talong), sliced\r\n    1 bundle string beans (sitaw), cut into 2-inch pieces\r\n    2 green chili peppers (siling haba)\r\n    1 packet (40g) sinigang mix (tamarind soup base)\r\n    1.5 liters water\r\n    Salt and pepper to taste', '    In a pot, bring water to a boil. Add pork and onions, then simmer until pork is tender.\r\n    Add tomatoes and sinigang mix. Simmer for 5 minutes.\r\n    Add radish, eggplants, string beans, and green chili peppers. Simmer until vegetables are tender.\r\n    Season with salt and pepper to taste. Adjust the sourness by adding more sinigang mix if needed.\r\n    Serve hot and enjoy this classic Filipino sour soup with steamed rice.', 6, 'Lunch');
INSERT INTO `recipe` (`recipeTitle`, `recipeImg`, `description`, `ingredients`, `instruction`, `serving`, `category`) VALUES
('Spicy Mango Salsa with fried wonton', , 'Spicy Mango Salsa with Crispy Wontons is a vibrant and flavorful appetizer. The sweet and tangy mango salsa with a hint of spice pairs perfectly with crunchy and golden-brown wontons, creating a delightful fusion of textures and tastes.', '    2 ripe mangoes, diced\r\n    1 red bell pepper, finely chopped\r\n    1/2 red onion, finely diced\r\n    1 jalape√±o, seeds removed and finely chopped\r\n    1/4 cup fresh cilantro, chopped\r\n    Juice of 2 limes\r\n    Salt and pepper to taste\r\n    Wonton wrappers\r\n    Cooking oil for frying', '    In a bowl, combine diced mangoes, red bell pepper, red onion, jalape√±o, and cilantro.\r\n    Squeeze lime juice over the mixture and gently toss. Season with salt and pepper to taste.\r\n    Cover the salsa and refrigerate for at least 30 minutes to let the flavors meld.\r\n    Cut wonton wrappers into desired shapes (triangles or squares).\r\n    Heat cooking oil in a pan for frying.\r\n    Fry the wontons until golden brown and crispy. Drain excess oil on paper towels.\r\n    Serve the spicy mango salsa in a bowl with the crispy wontons on the side.\r\n    Guests can scoop the salsa with the crispy wontons for a delicious and crunchy bite.', 4, 'Appetizer');
INSERT INTO `recipe` (`recipeTitle`, `recipeImg`, `description`, `ingredients`, `instruction`, `serving`, `category`) VALUES
('Taho', , 'Taho is a popular Filipino snack made of fresh soft/silken tofu, arnibal (sweet syrup), and sago pearls (similar to tapioca pearls). It\'s often sold by street vendors in the Philippines and enjoyed for breakfast or as a sweet treat.', '    1 pack (12 ounces) silken tofu, cubed\r\n    1 cup arnibal (sweet syrup)\r\n    1/2 cup sago pearls, cooked\r\n    Water (for boiling sago)\r\n    Brown sugar (optional, for added sweetness)', '    Cook sago pearls according to package instructions. Once cooked, drain and set aside.\r\n    In a saucepan, heat arnibal over low heat until it becomes a syrupy consistency. If it\'s too thick, you can add a bit of water to achieve the desired thickness.\r\n    In serving glasses, layer the cubed silken tofu, cooked sago pearls, and pour the sweet arnibal syrup over the top.\r\n    Optionally, sprinkle brown sugar on top for added sweetness.\r\n    Serve warm and enjoy this delightful Filipino street food snack.', 3, 'Breakfast');
INSERT INTO `recipe` (`recipeTitle`, `recipeImg`, `description`, `ingredients`, `instruction`, `serving`, `category`) VALUES
('Tapsilog', , 'Tapsilog is a Filipino dish with marinated beef,garlic fried rice, and a fried egg .', '300g beef sirloin\r\n3 tablespoons soy sauce\r\n2 tablespoons vinegar\r\n1 tablespoon brown sugar\r\n4 cloves garlic, minced\r\n1/2 teaspoon salt\r\n1/2 teaspoon black pepper\r\n3 cups cooked rice\r\n3 cloves garlic, minced (for the fried rice)\r\n3 eggs (for frying)', '    In a bowl, combine soy sauce, vinegar, brown sugar, minced garlic, salt, and black pepper. Mix well.\r\n    Marinate the sliced beef in the mixture for at least 30 minutes.\r\n    In a pan over medium heat, cook the marinated beef until fully cooked and slightly caramelized. Set aside.\r\n    In the same pan, saut√© minced garlic until golden brown. Add cooked rice and stir-fry until well-coated. Set aside.\r\n    In another pan, fry the eggs sunny-side-up or according to your preference.\r\n    Serve the garlic fried rice, topped with the cooked beef, and a fried egg on the side.', 3, 'Breakfast');
